import React from 'react';
import ProcessFlow from './pages/ProcessFlow';
import { Routes, Route } from "react-router-dom";

const App: React.FC = () => {
  return (
    <div>
      <Routes>
        <Route path='/mapeamentos'/>
      </Routes>
      <ProcessFlow />
    </div>
  );
};

export default App;
